import logo from './logo.svg';
import './App.css';

function App() {

  const board_list = [
    {
      'boardNo' : 1,
      'title' : '1번 글',
      'content' : '1번 글 내용',
      'writer' : '김자바',
      'regDate' : '2024-02-01'
    },
    {
      'boardNo' : 2,
      'title' : '2번 글',
      'content' : '2번 글 내용',
      'writer' : '홍길동',
      'regDate' : '2024-02-02'
    },
    {
      'boardNo' : 3,
      'title' : '3번 글',
      'content' : '3번 글 내용',
      'writer' : '이자바',
      'regDate' : '2024-02-07'
    },
    {
      'boardNo' : 4,
      'title' : '4번 글',
      'content' : '4번 글 내용',
      'writer' : '김자비',
      'regDate' : '2024-02-07'
    },
    {
      'boardNo' : 5,
      'title' : '5번 글',
      'content' : '5번 글 내용',
      'writer' : '유자바',
      'regDate' : '2024-02-08'
    }
  ];


  return (
    <div className="App">
        <div className='board-header'>
            <h3>게시글</h3>
        </div>
        <div className='board-table'>
          <table>
            <colgroup>
              <col width="15%"></col>
              <col width="30%"></col>
              <col width="30%"></col>
              <col width="*"></col>
            </colgroup>
            <tr>
              <td>글번호</td>  
              <td>제목</td>  
              <td>작성자</td>  
              <td>작성일</td>  
            </tr>  
          </table>          
        </div>
    </div>
  );
}

export default App;
